(* ::Text:: *)
(*A minimal model featuring first-order phase transition, see arXiv 1504.03291.*)


(* coupled fluid-field model *)
CFFModel::usage="CFFModel[] gives the coupled fluid-field model, see \!\(\*TemplateBox[{\"\\\"1504.03291\\\"\", \"https://arxiv.org/abs/1504.03291\"},\n\"HyperlinkURL\"]\).
CFFModel[n] gives the \!\(\*SuperscriptBox[\(n\), \(th\)]\) benchmark for the CFF model.
CFFModel[n,\"Transition\"] gives the Transition corresponding to the \!\(\*SuperscriptBox[\(n\), \(th\)]\) benchmark.
CFFModel[n,\"Benchmark\"] gives the \!\(\*SuperscriptBox[\(n\), \(th\)]\) benchmark parameters.
";
CFFModel[]:=Function[{\[Phi],T},"c2"/2 (T^2-"T0"^2) \[Phi]^2-"c3"/3 T \[Phi]^3+"c4"/4 \[Phi]^4]
CFFBenchmarks=With[{values={
		{140,1/18,11/250,3/200}, (* rational values *)
		{140,1/18,Sqrt[10]/72,5/324},(* Hindmarsch benchmarks, from 1504.03291 *)
		{140,2/9,Sqrt[10]/9,20/81},
		{140,1/9,Sqrt[10]/72,5/648},
		{100/Sqrt[2],1/18,Sqrt[10]/72,10/648},(* from 2303.18216 *)
		{100/Sqrt[2],1/9,Sqrt[10]/72,5/648},
		{100,16,0.2,0.01}(* our benchmark *)
		}},
	Dataset[AssociationThread[{"T0","c2","c3","c4"}->#]&/@values]
	];
CFFModel[i_Integer]:=Function[{\[Phi],T},CFFModel[][\[Phi],T]/.
	(CFFBenchmarks[i]//Normal//N)//Evaluate
	]
CFFModel[i_Integer,"Benchmark"]:=CFFBenchmarks[i]


